import React from "react";

function Sci (){
    const buttonHandler = () => {
        console.log('hello world');
    }

    const textHandler = () => {
        console.log('wpisuje tekst')
    }

    return (
        <div>
            <p>hdawdwa</p>
            <input type="button" value="dotknij mnie" onClick={buttonHandler}/>
            <input type="text" value="wpisuj malenki" onChange={textHandler} />

        </div>
    );
}

export default Sci;
